import React from 'react'

const Test = () => {

    const abi = [
        {
            "inputs": [
                {
                    "internalType": "address",
                    "name": "newOwner",
                    "type": "address"
                }
            ],
            "name": "changeOwner",
            "outputs": [],
            "stateMutability": "nonpayable",
            "type": "function"
        },
        {
            "inputs": [],
            "stateMutability": "nonpayable",
            "type": "constructor"
        },
        {
            "anonymous": false,
            "inputs": [
                {
                    "indexed": true,
                    "internalType": "address",
                    "name": "oldOwner",
                    "type": "address"
                },
                {
                    "indexed": true,
                    "internalType": "address",
                    "name": "newOwner",
                    "type": "address"
                }
            ],
            "name": "OwnerSet",
            "type": "event"
        },
        {
            "inputs": [],
            "name": "getOwner",
            "outputs": [
                {
                    "internalType": "address",
                    "name": "",
                    "type": "address"
                }
            ],
            "stateMutability": "view",
            "type": "function"
        }
    ]
    const getBlock = () => {
        const web3 = new Web3('HTTP://127.0.0.1:8545')
        // return web3.eth.getBlock('latest', (err, result) => {console.log(1)})
        const address = '0x32a61AA3C7de3CdB92D242d67C7Ae5ddff0aaf66'
        const contract = new web3.eth.Contract(abi, address)
        console.log(contract)
        contract.methods.getOwner().call().then(function(res){
            console.log(res);
        }).catch(function(err) {
            console.log(err);
        });


    }
    return (
        <div>
            <button onClick={() => getBlock()}>??</button>
        </div>
    )
}

export default Test
